import "./dashboard.css"

const Redflags = () => {
  return(
    <>
<div className="redflags">
<h3>Red flags</h3>
</div>
</>
  );
}
const Interventions = () => {
  return(
<>
<div className="intervene">
<h3>Interverventions</h3>
</div>
</>
  );
}
